import React from "react";

import ReactDOM  from "react-dom";

//import myname,{youtuber,fav} from "./App";
import * as ques from "./App";
ReactDOM.render(
    <><h1>My fav youtubers</h1>
        <ol>
            <li> {ques.default()}</li>
            <li>Elvish yadav</li>
            <li>MOinsideHit</li>
            <li> {ques.youtuber} </li>
            <li> {ques.fav} </li>
        </ol>
    </>,
    document.getElementById('root')
);
